import classes from "./Footer.module.css";

const Footer = (props) => {
  return (
    <section className={classes.Footer}>
      <p>
        <br />
        Grupo: Ramis Damasceno | Matheus Ausgust Gustavo Lemos <br />
        &copy; COPYRIGHT 2022 reserved by Cyber Food
      </p>
    </section>
  );
};

export default Footer;
